import React from "react";
import {
  MDBCard,
  MDBCardBody,
  MDBCardText,
  MDBCardImage,
} from "mdb-react-ui-kit";

export default function App() {
  return (
    <MDBCard
      style={{
        width: "100vw",
        height:'200px',
        marginTop: "2%",
        border: "1px solid",
        objectFit:'cover'
      }}
    >
      <MDBCardImage
        src="https://c.pxhere.com/photos/da/51/doctor_medical_medicine_health_stetoscope_healthcare_stethoscope_healthy-917205.jpg!d"
        alt="..."
        position="top"
      />
      <MDBCardBody>
        Médicos
        <MDBCardText>
          Especialistas de todas las áreas lo atenderán en forma presencial o
          por telemedicina; es el ofrecimiento de servicios médicos a distancia,
          utilizando para ello tecnologías de información y comunicación. Por lo
          tanto, en cualquier lugar del mundo donde se encuentre puede recibir
          asistencia.
        </MDBCardText>
      </MDBCardBody>
    </MDBCard>
  );
}
